import * as React from 'react';
import { Text, View, StyleSheet, TextInput } from 'react-native';

export default class App extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      mensagem: ""
    }
  }

  render(){
  return (
    <View style={styles.container}>
      <TextInput style={styles.input} placeholder='Entre com o peso'/>
      <TextInput style={styles.input} placeholder='Entre com a altura'/>
    </View>
  );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#CDCD',
    alignContent: 'center',
    alignItems: 'center',
    justifyContent: 'center',
    textAlign: 'center'
  }, input: {
    margin: 16,
    width: '300px'

  }
})
